- input: "TEXT\x1CC00468579\x1CT1\x1C\x1CF3A\x1CThe Committee has amended this Report
    to provide additional information regarding the donations mentioned in the October
    29, 2013 RFAI. Specifically, the $2400 of the donation from Mr. Lawrence Garatoni
    on 6/30/13 was presumptively redesignated to the general election.  $2600 of the
    donation from Mr. Garatoni on 6/30/13 was reattributed to the spouse of Mr. Garatoni.
    \ This gives Mr. Garatoni an aggregate donation during the current election cycle
    of $2600 for the Primary election and $2400 for the General election.  The Committee
    notified Mr. Garatoni of this action and an option to have the amount refunded
    if requested. This redesignation and rettribution will be shown in the amended
    October Quarterly Report.  Our record show that Mr. Robert Kersey donated $2000
    on 12/29/12 and $2500 on 3/21/13.  On 4/16/13 $2000 was reattributed to his spouse.
    \ Leaving Mr. Kersey with an aggregate donation of $2500. The April Quarterly
    Report showing the $2500 donation on 3/21/13 was just showing which donation the
    reattribution came from.  It is not a second donation of $2500.  The $2600 donation
    that was reattributed to Mr. Wilkinson on 6/30/13 from his spouse was in error.
    \ Instead the $5000 donation made by Mrs. Nancy Wilkinson was supposed to have
    $2400 redistributed to the 2014 General election, leaving $2600 attributed to
    the 2014 Primary.  Mr. Wilkinson total donations as of 6/30/13 is 2600.  This
    error has been fixed in this Amended Report.\n"
