    value: 'The Committee has amended this Report to provide additional information
      regarding the donations mentioned in the October 29, 2013 RFAI. Specifically,
      the $2400 of the donation from Mr. Lawrence Garatoni on 6/30/13 was presumptively
      redesignated to the general election.  $2600 of the donation from Mr. Garatoni
      on 6/30/13 was reattributed to the spouse of Mr. Garatoni.  This gives Mr. Garatoni
      an aggregate donation during the current election cycle of $2600 for the Primary
      election and $2400 for the General election.  The Committee notified Mr. Garatoni
      of this action and an option to have the amount refunded if requested. This
      redesignation and rettribution will be shown in the amended October Quarterly
      Report.  Our record show that Mr. Robert Kersey donated $2000 on 12/29/12 and
      $2500 on 3/21/13.  On 4/16/13 $2000 was reattributed to his spouse.  Leaving
      Mr. Kersey with an aggregate donation of $2500. The April Quarterly Report showing
