      came from.  It is not a second donation of $2500.  The $2600 donation that was
      reattributed to Mr. Wilkinson on 6/30/13 from his spouse was in error.  Instead
      the $5000 donation made by Mrs. Nancy Wilkinson was supposed to have $2400 redistributed
